import Settings from "./pages/settings/Settings";
import Login from "./pages/login/Login";
import Register from "./pages/register/Register";
import {BrowserRouter as Router,Switch,Route,Link
} from "react-router-dom";

function App() {
  return (
    <Router> 
      <TopBar/>

      <Switch>
      <Route path="/">
      <Home />
      </Route>

      </Switch>





    </Router>
  );
}

export default App;
